import Vue from 'vue/dist/vue'
import App from './App.vue'
import js from "./js/请求"
import Com from "./router/TestCom"

js.getChannels();

Vue.config.productionTip = false

/*new Vue({
  render: h => h(App),
}).$mount('#app')*/

new Vue({
  render(h) {
    return h(Com)
  }
})
